import CampaingModel from '../../../models/campaing'
import { HeaderContainer } from './styles'

interface Props {
  campaing: CampaingModel
}

const HeaderCampaing = ({ campaing }: Props) => {
  return(
    <HeaderContainer>
      {campaing.name}
    </HeaderContainer>
  )
}

export default HeaderCampaing
